import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Link,
  Routes,
  NavLink,
} from "react-router-dom";
import About from "./layouts/Main/About";
import Profile from "./layouts/Main/Profile";
import Home from "./layouts/Main/Home";


function App() {
  return (
    <Router>
      <nav>
        <p className="bg-[#50d71e] h-40">asbdhgasfgaklsgfkjasljfkaksljfkjasfkjl</p>
        <ul>
          <li>
            <Link to="/" className="bg-sky-500/100">Home</Link>
          </li>
          <li>
            <NavLink to="/About">About</NavLink>
          </li>
          <li>
            <NavLink
              to="/Profile"
            >
              Profile
            </NavLink>
          </li>
        </ul>
      </nav>
      <Routes>
        <Route exact path="/About" element={<About/>}>
        </Route>
        <Route exact path="/Profile" element={<Profile/>}>
        </Route>
        <Route exact path="/" element={<Home/>}></Route>
      </Routes>
    </Router>
  );
}

export default App;
